// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DaoVoting {
    struct Report {
        string description;
        uint yesVotes;
        uint noVotes;
        address submitter;
        bool resolved;
        mapping(address => bool) voted;
    }

    address public admin;
    uint public reportId;
    uint public votingPeriod = 3 days;
    mapping(uint => Report) public reports;
    mapping(uint => uint) public reportTimestamps;

    event ReportSubmitted(uint indexed id, string description, address submitter);
    event Voted(uint indexed id, address voter, bool voteYes);
    event ReportResolved(uint indexed id, bool approved);

    constructor() {
        admin = msg.sender;
    }

    function submitReport(string memory _description) public {
        Report storage newReport = reports[reportId];
        newReport.description = _description;
        newReport.submitter = msg.sender;
        newReport.resolved = false;
        reportTimestamps[reportId] = block.timestamp;
        
        emit ReportSubmitted(reportId, _description, msg.sender);
        reportId++;
    }

    function voteOnReport(uint _id, bool _voteYes) public {
        require(reports[_id].submitter != address(0), "Report doesn't exist");
        require(!reports[_id].voted[msg.sender], "Already voted");
        require(!reports[_id].resolved, "Voting closed");
        require(block.timestamp <= reportTimestamps[_id] + votingPeriod, "Voting period ended");

        if (_voteYes) {
            reports[_id].yesVotes++;
        } else {
            reports[_id].noVotes++;
        }

        reports[_id].voted[msg.sender] = true;
        emit Voted(_id, msg.sender, _voteYes);
    }

    function resolveReport(uint _id) public {
        require(msg.sender == admin, "Only admin");
        require(!reports[_id].resolved, "Already resolved");
        require(block.timestamp > reportTimestamps[_id] + votingPeriod, "Voting still open");

        reports[_id].resolved = true;
        bool approved = reports[_id].yesVotes > reports[_id].noVotes;
        emit ReportResolved(_id, approved);
    }

    function getReport(uint _id) public view returns (
        string memory description,
        uint yesVotes,
        uint noVotes,
        address submitter,
        bool resolved,
        bool canVote,
        bool isVotingOpen
    ) {
        Report storage r = reports[_id];
        isVotingOpen = block.timestamp <= reportTimestamps[_id] + votingPeriod && !r.resolved;
        return (
            r.description,
            r.yesVotes,
            r.noVotes,
            r.submitter,
            r.resolved,
            !r.voted[msg.sender],
            isVotingOpen
        );
    }
}

